INSERT INTO `comunicado` VALUES (1,'admin','todos','Prezados(as) diretores(as), Coordenadores(as), professores(as), pais, mães, alunas e alunos:\r\n\r\nA Prefeitura Municipal, diante da pandemia de Covid19, teve a iniciativa de implantar o sistema de aulas remotas por meio de um sistema simples, que pode ser acessado por computadores, notebooks, netbooks, tablets e smartfones. Tal iniciativa se faz necessária para que não há maiores prejuízos de ensino e aprendizagem aos nossos queridos alunos e alunas.\r\nAs aulas podem ser assistidas online e também acessadas em outros momentos, já que são gravadas. Nesse mesmo sistema, constam materiais em apostilas, material de apoio, vídeos e atividades avaliativas. \r\nA pandemia, mesmo com todos os malefícios que trouxe, teve o lado positivo de fazer com que entrássemos no mundo digital de forma antecipada.\r\nAssim, contamos com a participação de todas e todos, para que nossos alunos tenham acesso ao ensino de qualidade que sempre tiveram, mas agora de forma digital e também mista, ou seja, digital e presencial.\r\nNós, da Prefeitura Municipal de Saperelândia, agradecemos o empenho e participação de todos vocês.\r\n\r\nAbraço Fraternal,\r\n\r\nProfa. Maria Aparecida Fernandes \r\nSecretária Municipal de Educação de Saperelândia\r\n\r\nEm caso de dúvidas ou problemas no sistema, contactar 14 9999 9999','2020-08-04 11:18:35','31/12/2020','2020-08-04 14:08:18','2020-08-04 14:18:35'),(2,'professor','aluno','fasdfasdfa','2020-08-04 11:32:02','04/08/2020','2020-08-04 14:19:34','2020-08-04 14:32:02');
/*!40000 ALTER TABLE `comunicado` ENABLE KEYS */;
UNLOCK TABLES;

